# 3.3.1 Sensitivity analysis 

To assess the influence of model parameters and their contributions to the variability of model outputs, we conduct a global sensitivity analysis using Sobol indices. Specifically, we calculate both first-order $\left(S_{i}\right)$ and total-effect $\left(S_{T_{i}}\right)$ Sobol indices for the key model parameters. $S_{i}$ (equation 10) measures the individual contribution of parameter $i$ on the output variance, while $S_{T_{i}}$ (equation 11) captures the total contribution of the parameter, which includes both individual effects and interactions of the parameter with other parameters $[42,43]$.

$$
\begin{gathered}
S_{i}=\frac{V_{i}}{\operatorname{Var}(V)} \\
S_{T_{i}}=S_{i}+\sum_{j \geq 1} S_{i j}+\ldots+S_{u}=1-S_{\sim i}
\end{gathered}
$$

where $V, V_{i}$ are the total variance of the model function and the partial variance contribution of each of the key parameters, respectively and $S_{\sim i}$ is the sum of all partial sensitivity indices $S_{u}$ except $S_{i}$. Sobol' indices are computed using SALib (Sensitivity Analysis Library in Python) [44, 45]. SALib's saltelli sampling scheme is used to generate the necessary model evaluation points $2^{14}$ times. The tested parameters are assumed to follow uniform distributions within $20 \%$ of the optimal parameter values determined during calibration. As the parameters relating to BVTV, $C_{\text {width }}$ and lattice spacing are fitted for Ti and $\mathrm{Mg}-10 \mathrm{Gd}$ and then applied to $\mathrm{Mg}-5 \mathrm{Gd}$, the sensitivity analysis is performed for the former two materials only. For volume loss, the optimal parameter ranges of both $\mathrm{Mg}-5 \mathrm{Gd}$ and $\mathrm{Mg}-10 \mathrm{Gd}$ are considered for the sensitivity analysis.
